from gmpy2 import is_prime
def ok(n):
    if not is_prime(n): return False
    s, b = str(n), bin(n)[2:]
    return is_prime(int(b+s+b)) and is_prime(int(s+b+s))
print([k for k in range(2*10**5) if ok(k)]) # _Michael S. Branicky_, Oct 23 2025

